  false,\n\t\"url\": null,\n\t\"notes\": \"Nesting success in all 4 species remained
  considerably below levels reported in recent years. Cackling Canada geese averaged
  44% nest survival and Emperor geese had 66% nest success, both about the same as
  the low production shown last year. White-fronted geese declined to 60% nest success
  and Pacific Black Brant increased slightly to 37% success. Although 1985 was a late
  spring, clutch size, nesting density, and nesting success were close to levels observed
  in 1984, an average year with respect to environmental conditions.\",\n\t\"owner_org\":
